import './App.css';
import {Route,Switch} from 'react-router-dom';


import Home from './components/Home';
import About from './components/About';
import Book from './components/Book';
import Menu from './components/Menu';

function App() {
  return (
    <div className="App">
      <Home/>
      <Menu/>
      <About/>
      <Book/>
      </div>
  );
}

export default App;
